import React from "react";
import chercher from "../icons/chercher.svg";

const Navbar = () => {
  return (
    <div>
      <input className="recherche" type="text" placeholder="Recherche" />
      <img src={chercher} alt="" />
    </div>
  );
};

export default Navbar;
